import { PORT } from '../constants/constants';

const Adapter = {
    createMap: async (row, col) => {
        const res = await fetch('/wocao', {
            method: "POST",
            body: JSON.stringify({row: row, col: col})
        });
        const body = await res.json();
        console.log(body);
        return body;
    }
};

export default Adapter;
